import React from "react";
import "./App.css";
import useExchange from "./data/useExchange";
import { crypto, securitiesHiRisk } from "./data/data";

const App = () => {
  const rates = useExchange();
  const btcAmount = ((1 / rates.BTC) * crypto.amount).toFixed(2);
  return <div className="App">{btcAmount} USD</div>;
};

export default React.memo(App);

